For sale is a LNIB Smith & Wesson "E" Series SS 1911 .45ACP semi-auto.  Again, like new in the box with 2-8rd. mags, not sure where the ppwk is though.  A couple upgrades on this pistol, it has new Meprolight TRU DOT night sights and a beveled mag well installed.  It can come with either the light smooth wood grips or the dark checkered wood grips, just let me know which, I don't have the factory sights or grip panels.  Specs:  http://www.gandermountain.com/modperl/prod uct/details.cgi?pdesc=Smith-Wesson-1911-E-Series-Handgun&i=721743&r=view&from=grid& nbsp ;
$900 firm in cash or higher in trade value.I might consider trades, but only if it's a good deal as I don't need anything right now.  If it's not a good deal as far as the value goes, then there is no reason to offer it, sorry, just trying to save everyone some time.  If offering a trade, please be specific on exactly what you have and exactly what you are wanting to do so I know the deal.  Please don't message me with things like "Glock?" or "AR-15?" just for me to contact you for the details and you are wanting to straight trade on a Glock or a $600 AR, let's save each other some time please.Trades considered would be in this order, semi-auto rifles and pistols, revolvers, then tactical shotguns and bolt-guns.
Ammo in common rifle and pistol calibers to help with a deal, but I have PLENTY of ammo.1oz. silver bars, rounds or Eagles and grams of gold.  Maybe optics to help, but I have nice scopes, Aimpoints and Eotechs just sitting right now for future projects.Ftf in the Dallas area and must be legal to own a firearm in TX.Thanks for looking!
